import React, { Component } from 'react';

class AddBetModal extends Component {
    constructor(props) {
        super(props);

        this.state = {
            bet1: 0,
            bet2: 0,
            betT: 0
        }

        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(event) {
        this.setState({ [event.target.id]: event.target.value });
    }

    render() {
        return (
            <div id="AddBetModal" className="modal fade" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog" role="document">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h5 className="modal-title" id="exampleModalLabel">Add bet</h5>
                            <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                                <span aria-hidden="true">&times;</span>
                            </button>
                        </div>

                        <div className="modal-body">
                            <div className="form-row">
                                <div className="input-group col-md-4">
                                    <input type="number" min="0" step="0.01" className="form-control" id="prob1" placeholder="Team 1..." value={this.state.bet1} onChange={this.handleChange} />
                                </div>

                                <div className="input-group col-md-4">
                                    <input type="number" min="0" step="0.01" className="form-control" id="tie" placeholder="Tie..." value={this.state.betT} onChange={this.handleChange} />
                                </div>

                                <div className="input-group col-md-4">
                                    <input type="number" min="0" step="0.01" className="form-control" id="prob2" placeholder="Team 2..." value={this.state.bet2} onChange={this.handleChange} />
                                </div>
                            </div>

                            <div class="modal-footer">
                                <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                                <button type="button" className="btn btn-primary">Save changes</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default AddBetModal;
